script: |
  super -f text -I q9685.spq | sort > q9685.out

inputs:
  - name: q9685.spq
    data: |
      SELECT DISTINCT - cor0.col2 AS col2 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) cor0, tab2 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9685.out
    data: |
      -54
      -57
      -96
